import React from 'react'
import Button from '@material-ui/core/Button'
import Layout from '../components/layout'
import DashCard from '../components/dashboard/DashCard'
import styles from '../styles/modules/diary.module.scss'

const Dashboard = () => {
    return (
        <Layout>
            <div className={styles.dashboard}>
                {links.map((l) => (
                    <DashCard
                        key={l.title}
                        className={styles.dash_button}
                        image={l.img}
                        title={l.title}
                    ></DashCard>
                ))}
            </div>
        </Layout>
    )
}
const links = [
    { title: 'Diary', to: '/diary', img: '/static/dashboard/dash1.jpg' },
    { title: 'ToDo', to: '/todo', img: '/static/dashboard/dash2.jpg' },
    {
        title: 'Food Diary',
        to: '/food-diary',
        img: '/static/dashboard/dash3.jpg',
    },
]
export default Dashboard
